import React from 'react';
import Pageadmin from 'layouts/page-admin';
import { Row , Col , Card , CardBody , CardTitle} from 'reactstrap';


class ListLaporanAnalisa extends React.Component{
    render(){
        let periode = [
            {
                name: 'Laporan Harian'
            },
            {
                name: 'Laporan Harian'
            },
            {
                name: 'Laporan Harian'
            },
            {
                name: 'Laporan Harian'
            },
        ]
        return(
            <Pageadmin>
                <Row style={{ height: '535px'}}>
                    <Col sm='3'>
                        <Card className="card-stats mb-4 mb-lg-0">
                            <CardBody>
                                <Row>
                                    <div className="col">
                                    <CardTitle className="font-weight-bold" style={{marginTop:'10px'}}>
                                        Laporan Harian
                                    </CardTitle>
                                    </div>
                                    <Col className="col-auto">
                                    <div className="icon icon-shape bg-danger text-white rounded-circle shadow">
                                        <i className="fas fa-chart-bar" />
                                    </div>
                                    </Col>
                                </Row>
                            </CardBody>
                        </Card>
                    </Col>
                    <Col sm='9'>
                    </Col>
                </Row>
            </Pageadmin>
        )
    }
}


export default ListLaporanAnalisa;
